import React from 'react';
function App() {
    let likes = 0;


    function increment() {
        likes += 1;
        console.log(likes);
    }
    function decrement() {
        likes -= 1;
        console.log(likes);
    }
    return (
    <div className="App">

      <button onClick={increment}>Increment</button>
      <button onClick={decrement}>Decrement</button>
        <h1>{likes}</h1>
    </div>
  );
}

export default App;
